import { FaTwitterSquare, FaGooglePlus, FaBehanceSquare, FaYoutube , FaFacebook , FaInstagram} from 'react-icons/fa';

const MediaEnums = [
    {
        label: "facebook",
        value: "facebook",
        icon:   "facebook"
    },
    {
        label: "youtube",
        value: "youtube",
        icon: <FaYoutube />
    },
    {
        label: "instagram",
        value: "instagram",
        icon: <FaInstagram />
    }, {
        label: "twitter",
        value: "twitter",
        icon: <FaTwitterSquare />
    }
]


export default MediaEnums;
